# DP Tabulation
from typing import List

class Solution:
    def countSquares(self, matrix: List[List[int]]) -> int:
        rows = len(matrix)
        cols = len(matrix[0])
        grid = [[0 for _ in range(cols)] for _ in range(rows)]
        res = 0
        for r in range(rows):
            for c in range(cols):
                if r == 0 or c == 0:
                    grid[r][c] = matrix[r][c]
                else:
                    if matrix[r][c] == 1:
                        grid[r][c] = min(grid[r-1][c-1], grid[r][c-1], grid[r-1][c]) + 1
                res += grid[r][c]
        return res

